using System;

namespace AdventOfCode02_1
{
    public class Program
    {
        public static void Main(string[] args)
        {
            string[] inputs = new string[] {
                "",
                "",
                "",
                "",
                ""
            };

            char[][] keypad = new char[][]{
                new char[] {' ', ' ', '1', ' ', ' '},
                new char[] {' ', '2', '3', '4', ' '},
                new char[] {'5', '6', '7', '8', '9'},
                new char[] {' ', 'A', 'B', 'C', ' '},
                new char[] {' ', ' ', 'D', ' ', ' '}
            };
            int X = 0, Y = 2;
            int Xtmp, Ytmp;

            foreach(var instruction in inputs)
            {

                foreach(var letter in instruction)
                {
                    Xtmp = X;
                    Ytmp = Y;

                    switch(letter)
                    {
                        case 'U':
                            Ytmp -= 1;
                            break;
                        case 'D':
                            Ytmp += 1;
                            break;
                        case 'L':
                            Xtmp -= 1;
                            break;
                        case 'R':
                            Xtmp += 1;
                            break;
                    }

                    Xtmp = (Xtmp > 4 ? 4 : (Xtmp < 0 ? 0 : Xtmp));
                    Ytmp = (Ytmp > 4 ? 4 : (Ytmp < 0 ? 0 : Ytmp));

                    if(keypad[Ytmp][Xtmp] != ' ')
                    {
                        X = Xtmp;
                        Y = Ytmp;
                    }
                }
                Console.Write(keypad[Y][X]);
            }
        }
    }
}
